#!/usr/bin/env python3
"""
Mock XML Data Generator for Testing

Generates valid mock XML records with unique app_ids and con_ids for testing.
Allows repeatable, clean batch size tests without running out of data.

Generated XMLs follow the same structure as production Provenir XML.
"""

import sys
import random
import string
from pathlib import Path
from datetime import datetime, timedelta
from typing import List, Tuple

# Add project root to path
project_root = Path(__file__).parent.parent
sys.path.insert(0, str(project_root))

from xml_extractor.database.migration_engine import MigrationEngine
from tests.integration.test_database_connection import DatabaseConnectionTester


class MockXMLGenerator:
    """Generates valid mock Provenir XML for testing."""
    
    def __init__(self):
        """Initialize with database connection."""
        # Initialize database connection
        self.db_tester = DatabaseConnectionTester()
        success, message = self.db_tester.test_connection()
        if not success:
            raise RuntimeError(f"Database connection failed: {message}")
        
        self.connection_string = self.db_tester.build_connection_string()
        self.migration_engine = MigrationEngine(self.connection_string)
    
    def generate_and_insert_mock_xmls(self, count: int, start_app_id: int = 700000) -> int:
        """
        Generate and insert mock XMLs into app_xml table.
        
        Args:
            count: Number of mock XMLs to generate
            start_app_id: Starting app_id (will increment)
            
        Returns:
            Number of XMLs successfully inserted
        """
        print(f"\nðŸ”„ Generating {count} mock XML records...")
        print(f"   Starting app_id: {start_app_id}")
        
        inserted_count = 0
        
        try:
            with self.migration_engine.get_connection() as conn:
                cursor = conn.cursor()
                
                # Detect whether app_xml.app_id is an IDENTITY column. If it is,
                # we'll omit app_id from the INSERT and rely on the DB to assign it.
                try:
                    cursor.execute(
                        "SELECT COLUMNPROPERTY(OBJECT_ID('dbo.app_xml'), 'app_id', 'IsIdentity')"
                    )
                    colprop = cursor.fetchone()
                    is_identity = bool(colprop and colprop[0] == 1)
                except Exception:
                    # If detection fails, assume identity = False to preserve previous behavior
                    is_identity = False

                for i in range(count):
                    app_id = start_app_id + i

                    # Generate mock XML
                    xml_content = self._generate_mock_xml(app_id)

                    # Insert into app_xml table and capture inserted.app_id
                    try:
                        if is_identity:
                            insert_sql = (
                                "INSERT INTO app_xml (app_XML) "
                                "OUTPUT inserted.app_id VALUES (?)"
                            )
                            params = (xml_content,)
                        else:
                            insert_sql = (
                                "INSERT INTO app_xml (app_id, app_XML) "
                                "OUTPUT inserted.app_id VALUES (?, ?)"
                            )
                            params = (app_id, xml_content)

                        cursor.execute(insert_sql, params)

                        # Attempt to read returned inserted.app_id
                        returned_app_id = None
                        try:
                            row = cursor.fetchone()
                            if row:
                                returned_app_id = row[0]
                        except Exception:
                            returned_app_id = None

                        # If OUTPUT didn't return a value and the column is identity,
                        # try SCOPE_IDENTITY() as a fallback
                        if returned_app_id is None and is_identity:
                            try:
                                cursor.execute("SELECT CAST(SCOPE_IDENTITY() AS BIGINT)")
                                r2 = cursor.fetchone()
                                if r2:
                                    returned_app_id = r2[0]
                            except Exception:
                                returned_app_id = None

                        if returned_app_id is None and not is_identity:
                            # For non-identity tables we expect the provided app_id to be used
                            returned_app_id = app_id

                        inserted_count += 1

                        # Ensure there is a corresponding row in [dbo].[application]
                        if returned_app_id is not None:
                            try:
                                cursor.execute(
                                    "IF NOT EXISTS (SELECT 1 FROM [dbo].[application] WHERE app_id = ?) "
                                    "INSERT INTO [dbo].[application] (app_id) VALUES (?)",
                                    (returned_app_id, returned_app_id)
                                )
                            except Exception as e2:
                                print(f"   âš ï¸  Warning ensuring application row for app_id {returned_app_id}: {e2}")
                        else:
                            print(f"   âš ï¸  Could not determine inserted app_id for XML record starting app_id {app_id}; skipping application upsert")

                        # Progress indicator
                        if (i + 1) % 50 == 0 or i == count - 1:
                            print(f"   Progress: {i + 1}/{count} records inserted...")

                    except Exception as e:
                        # Skip duplicates or other insert errors
                        error_str = str(e)
                        if "PRIMARY KEY" in error_str or "Duplicate" in error_str:
                            print(f"   âš ï¸  app_id {app_id} already exists, skipping")
                        else:
                            print(f"   âŒ Error inserting app_id {app_id}: {error_str}")
                            if i == 0:  # Print details for first error
                                print(f"      XML length: {len(xml_content)}")
                                print(f"      First 200 chars: {xml_content[:200]}")
                        continue
                
                # Finished inserting mock records
                
                # Commit transaction
                try:
                    conn.commit()
                    print(f"   âœ… Transaction committed successfully")
                except Exception as e:
                    print(f"   âŒ Failed to commit transaction: {e}")
                    return inserted_count
                
        except Exception as e:
            print(f"âŒ Error during insertion: {e}")
            return inserted_count
        
        print(f"âœ… Inserted {inserted_count} mock XML records")
        return inserted_count
    
